"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?11/25/11666?source=see_link\">",
"       Patient information: Painful periods (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?0/8/143?source=see_link\">",
"       Patient information: Endometrial ablation (The Basics)",
"      </a>",
"     </p>",
