"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F68801%7ECARD%2F87117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
