"   <div class=\"block mop drugH1Div\" id=\"F8018403\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Routine physical examination that includes blood pressure and Papanicolaou smear, breast exam, mammogram. Monitor for signs of endometrial cancer in female patients with uterus. Adequate diagnostic measures, including endometrial sampling, if indicated, should be performed to rule out malignancy in all cases of undiagnosed abnormal vaginal bleeding. Monitor for loss of vision, sudden onset of proptosis, diplopia, migraine; signs and symptoms of thromboembolic disorders; glycemic control in patients with diabetes; lipid profiles in patients being treated for hyperlipidemias; thyroid function in patients on thyroid hormone replacement therapy.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Menostar&reg;:  When used in a woman with a uterus, endometrial sampling is recommended at yearly intervals or when clinically indicated.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Menopausal symptoms, vulvar and vaginal atrophy: Assess need for therapy at 3- to 6-month intervals",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Prevention of osteoporosis: Bone density measurement",
"    </p>",
"   </div>",
"   <div class=\"block rer drugH1Div\" id=\"F8018384\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reference Range",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Children 6 months to 10 years: &lt;15 pg/mL (SI: &lt;55 pmol/L)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Males: 10-50 pg/mL (SI: 37-184 pmol/L)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Females:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Premenopausal: 30-400 pg/mL (SI: 110-1468 pmol/L) (depending on phase of menstrual cycle)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Postmenopausal: 0-30 pg/mL (SI: 0-110 pmol/L)",
"    </p>",
"   </div>",
