"   <div class=\"block pha drugH1Div\" id=\"F8018378\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Estrogens are responsible for the development and maintenance of the female reproductive system and secondary sexual characteristics. Estradiol is the principle intracellular human estrogen and is more potent than estrone and estriol at the receptor level; it is the primary estrogen secreted prior to menopause. Following menopause, estrone and estrone sulfate are more highly produced. Estrogens modulate the pituitary secretion of gonadotropins, luteinizing hormone, and follicle-stimulating hormone through a negative feedback system; estrogen replacement reduces elevated levels of these hormones in postmenopausal women.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F8018385\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Well absorbed from the gastrointestinal tract, mucous membranes, and the skin. Average serum estradiol concentrations (C",
"     <sub>",
"      avg",
"     </sub>",
"     ) vary by product",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Oral: Femtrace&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 23.5-92.1 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Injection: Estradiol valerate and estradiol cypionate are absorbed over several weeks following I.M. injection",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Alora&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 41-98 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Climara&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 22-106 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Divigel&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 9.8-30.5 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Elestrin&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 15.4-39.2 pg/mL; Exposure increased by 55% with application of sunscreen 10 minutes prior to dose",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Estraderm&reg; 0.1 mg/day: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 73 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Estrasorb&reg;: Mean serum concentration on day 22 of therapy: ~35-65 pg/mL; Exposure increased by 35% with application of sunscreen 10 minutes prior to dose",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Estrogel&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     on day 14 of therapy: 28.3 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Evamist&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 19.6-30.9 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Menostar&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 13.7 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Vivelle-Dot&reg;: C",
"     <sub>",
"      avg",
"     </sub>",
"     : 34-104 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Vaginal: Femring&reg;: Rapid during the first hour following application, then declines to a steady rate over 3 months; C",
"     <sub>",
"      avg",
"     </sub>",
"     : 40.6-76 pg/mL",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Widely distributed; high concentrations in the sex hormone target organs",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: Bound to sex hormone-binding globulin and albumin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic; partial metabolism via CYP3A4 enzymes; estradiol is reversibly converted to estrone and estriol; oral estradiol also undergoes enterohepatic recirculation by conjugation in the liver, followed by excretion of sulfate and glucuronide conjugates into the bile, then hydrolysis in the intestine and estrogen reabsorption. Sulfate conjugates are the primary form found in postmenopausal women. With transdermal application, less estradiol is metabolized leading to higher circulating concentrations of estradiol and lower concentrations of estrone and conjugates.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Femtrace&reg;: 21-26 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, plasma: Oral: Femtrace&reg;: 0.4-0.75 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Primarily urine (as estradiol, estrone, estriol and their glucuronide and sulfate conjugates)",
"    </p>",
"   </div>",
"  </div>",
