var title_f14_25_14749="Plasmin and thrombolysis";
var content_f14_25_14749=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77087&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77087&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    The genesis and function of plasmin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 362px; height: 224px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The inactive precursor, plasminogen, acted upon by intrinsic and extrinsic activators, is converted to the active enzyme, plasmin. Plasmin digests fibrin, the predominant structural component of most intravascular thrombi in the arterial circulatory system, and, to a lesser degree, circulating fibrinogen. The lysis of fibrin generates cross-linked fibrin degradation products (XLFDP) while fibrinogen breakdown yields fibrin(ogen) degradation products (FDP). Thrombin, a pivotal enzyme in hemostatic and pathologic thrombotic processes, converts fibrinogen to fibrin, activates factor XIII (responsible for fibrin monomer crosslinking), and is also a potent platelet activator.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
