var title_f14_25_14750="Anti-IgE trial design";
var content_f14_25_14750=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F71216&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F71216&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 497px\">",
"   <div class=\"ttl\">",
"    Study design of pivotal trials of omalizumab",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 477px; height: 269px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The adult pivotal trials were identical in terms of study design and included four distinct phases: run-in, steroid-withdrawal, and double-blind extension. During the run-in phase, patients' standard therapy was switched to inhaled budesonide (BDP) and stabilized, which required the investigator to adjust the BDP dose so that the patients entered the core study period (steroid-stable phase) symptomatic yet exacerbation-free.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Busse, WJ. Anti-immunoglobulin E (Omalizumab) therapy in allergic asthma. Am J Respir Crit Care Med 2001; 164:S12. Copyright &copy; 2001 American Thoracic Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
